import React from 'react';

const menuStyle = {
    width: '20px',
    height: '20px',
    margin: '0 15px',
    backgroundSize: 'cover',
    backgroundColor: '#ffffff',
    backgroundImage: 'url(data:image/png;base64,)',
    backgroundRepeat: 'no-repeat',
    border: 'none',
}

function Header() {
    return (
        <div className="header">
            <button style={ menuStyle } />
            <h1>구독과 좋아요</h1>
        </div>
    )
}

export default Header;
